import React from "react";
import "./Button.css";

const Button = () => {
  const goalSubmit = (e) => {
    e.preventDefault();
  }

  return (
    <button type="submit" className="button" onSubmit={goalSummit}>
      Add Goal
    </button>
  );
};

export default Button;
